@frod7600
It's not so difficult. Just copy the amtlib.dll from DLL FILE\32bit\ and replace one you have in your program folder (eg. Program Files\Adobe\Adobe Dreamweaver CS5.5). That's it.
P.S. Hope you've changed your host file as instructed.

@delta47: DO NOT mix your bank details, occupation, adobe and pirated adobe software together. The hacks and torrents, especially by thethingy, work perfectly today, but you have no way of knowing how adobe will respond. If you work for a blue chip company, or one that has corporate clients, then get them to buy you a copy, don't risk your livelyhood.

I have an extensive number of blocks in place, in my host file and both firewalls, but if an adobe program needs to interact with adobe, like updating flash player, you can't be certain that adobe won't add an audit of their programs on your system as part of the update. 

The UK has similar laws to the US, and until our government grows a pair, and tells the US to fuck off, adobe can hack your system and take action against your employers. It's just not worth their time or expense, chasing individuals who only muck about with the programs at home. That's what the wankers in the US government do best.
